import React from 'react';

function About() {
  return (
    <div>
      <h1>About This Application</h1>
      <p>
        This application is a portfolio showcasing the projects and skills of the developer.
        It includes various sections such as Home, Projects, Contact, and About.
      </p>
      <p>
        The application is built using React and integrates with Firebase for handling messages
        from the Contact page.
      </p>
    </div>
  );
}

export default About;
